import React from 'react';
import { useParams } from 'react-router-dom';

import { styTitle, styContainer } from './style';

const InventoryDetail = () => {
  let { id } = useParams();

  return (
    <div className={styContainer}>
    <div>
    </div>
      <div>Back Button</div>
      <div>Edit Button</div>
      <h1 className={styTitle}>Inventory Detail</h1> {id}
    </div>
  );
};

export default InventoryDetail;
